import './Header.css';

function Header(){
    return(
        <header className="header">
           <ul className="footer-list">
            <li className="footer-item">
                <a className="footer-link" href="https://getyourpet.com/privacy-policy/">Privacy Policy</a>
            </li>
           </ul>

        </header>
    );
}
export default Header;
